import 'rhfa-emergency-styles/dist/styles.css'
import Spinner from '../Utils/Spinner';
import { ErrorMessage, Field, Form, Formik } from 'formik';
import { useParams } from "react-router";
import { Link, } from "react-router-dom";
import InfoErrorApi from '../Utils/InfoErrorApi';
import InfoExitoApi from '../Utils/InfoExitoApi';
import GenericApi from '../Api/Services/GenericApi';
import ModalGen from '../Utils/Modals/ModalGeneric';
import { Navigate } from "react-router-dom";
import { getUser } from '../Utils/Common';

function FaseDetalle() {

    let { id} = useParams();


    useEffect(() => {
        window.showSpinner(true);
        async function fetchData() {
            cargarInfoFase();
        }
        fetchData();
    }, []);


    const cargarInfoFase = () => {

        GenericApi.getGeneric("mas-fase").then(
            datos => {
              
                if (!datos.error) {
                    console.log("Prueba");
                    //setListaUsuarios(datos);
                    //setRespuestaUsuarios(true);
                }
                else {
                    window.showModal(1);
                }
                //getDependenciaById();
            }
        )
    }


    return (

        <>
           

            <div className="w2d_block">
                <nav aria-label="breadcrumb">
                    <ol className="breadcrumb breadcrumb-alt push">
                        <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/Fase`}><small>Lista de fases</small></Link></li>
                        <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ListarMigracionAntecedentes`}><small>Fase</small></Link></li>
                    </ol>
                </nav>
            </div>

            <div className="col-md-12">
               
            </div>
        </>
    )



};

export default FaseDetalle;
